import React, { useState, useCallback } from 'react';
import ReactFlow, {
  Node,
  Edge,
  addEdge,
  Connection,
  useNodesState,
  useEdgesState,
  Controls,
  Background,
  BackgroundVariant,
} from 'reactflow';
import 'reactflow/dist/style.css';

// Component types for the palette
interface ComponentType {
  id: string;
  label: string;
  icon: string;
  color: string;
  description: string;
}

const componentTypes: ComponentType[] = [
  {
    id: 'microservice',
    label: 'Microservice',
    icon: 'ðŸ”§',
    color: '#3B82F6',
    description: 'Independent service'
  },
  {
    id: 'database',
    label: 'Database',
    icon: 'ðŸ’¾',
    color: '#F59E0B',
    description: 'Data storage'
  },
  {
    id: 'cache',
    label: 'Cache',
    icon: 'âš¡',
    color: '#EF4444',
    description: 'Fast data access'
  },
  {
    id: 'loadbalancer',
    label: 'Load Balancer',
    icon: 'âš–ï¸',
    color: '#10B981',
    description: 'Traffic distribution'
  },
  {
    id: 'queue',
    label: 'Message Queue',
    icon: 'ðŸ“¬',
    color: '#8B5CF6',
    description: 'Async messaging'
  },
  {
    id: 'apigateway',
    label: 'API Gateway',
    icon: 'ðŸšª',
    color: '#06B6D4',
    description: 'Single entry point'
  }
];

// Enhanced initial setup with better styling
const initialNodes: Node[] = [
  {
    id: '1',
    position: { x: 400, y: 100 },
    data: { label: 'ðŸšª API Gateway' },
    style: { 
      background: 'linear-gradient(135deg, #06B6D4, #0891B2)', 
      color: 'white', 
      padding: '16px 20px', 
      borderRadius: '12px', 
      fontWeight: '600',
      fontSize: '14px',
      boxShadow: '0 4px 12px rgba(6, 182, 212, 0.3)',
      border: '2px solid rgba(255, 255, 255, 0.2)',
      minWidth: '140px',
      textAlign: 'center'
    }
  },
  {
    id: '2',
    position: { x: 200, y: 250 },
    data: { label: 'ðŸ”§ User Service' },
    style: { 
      background: 'linear-gradient(135deg, #3B82F6, #2563EB)', 
      color: 'white', 
      padding: '16px 20px', 
      borderRadius: '12px', 
      fontWeight: '600',
      fontSize: '14px',
      boxShadow: '0 4px 12px rgba(59, 130, 246, 0.3)',
      border: '2px solid rgba(255, 255, 255, 0.2)',
      minWidth: '140px',
      textAlign: 'center'
    }
  },
  {
    id: '3',
    position: { x: 600, y: 250 },
    data: { label: 'ðŸ”§ Order Service' },
    style: { 
      background: 'linear-gradient(135deg, #3B82F6, #2563EB)', 
      color: 'white', 
      padding: '16px 20px', 
      borderRadius: '12px', 
      fontWeight: '600',
      fontSize: '14px',
      boxShadow: '0 4px 12px rgba(59, 130, 246, 0.3)',
      border: '2px solid rgba(255, 255, 255, 0.2)',
      minWidth: '140px',
      textAlign: 'center'
    }
  },
  {
    id: '4',
    position: { x: 300, y: 400 },
    data: { label: 'ðŸ’¾ PostgreSQL' },
    style: { 
      background: 'linear-gradient(135deg, #F59E0B, #D97706)', 
      color: 'white', 
      padding: '16px 20px', 
      borderRadius: '12px', 
      fontWeight: '600',
      fontSize: '14px',
      boxShadow: '0 4px 12px rgba(245, 158, 11, 0.3)',
      border: '2px solid rgba(255, 255, 255, 0.2)',
      minWidth: '140px',
      textAlign: 'center'
    }
  },
  {
    id: '5',
    position: { x: 500, y: 400 },
    data: { label: 'âš¡ Redis Cache' },
    style: { 
      background: 'linear-gradient(135deg, #EF4444, #DC2626)', 
      color: 'white', 
      padding: '16px 20px', 
      borderRadius: '12px', 
      fontWeight: '600',
      fontSize: '14px',
      boxShadow: '0 4px 12px rgba(239, 68, 68, 0.3)',
      border: '2px solid rgba(255, 255, 255, 0.2)',
      minWidth: '140px',
      textAlign: 'center'
    }
  }
];

const initialEdges: Edge[] = [
  { 
    id: 'e1-2', 
    source: '1', 
    target: '2', 
    animated: true,
    style: { stroke: '#10B981', strokeWidth: 3 }
  },
  { 
    id: 'e1-3', 
    source: '1', 
    target: '3', 
    animated: true,
    style: { stroke: '#10B981', strokeWidth: 3 }
  },
  { 
    id: 'e2-4', 
    source: '2', 
    target: '4',
    style: { stroke: '#6B7280', strokeWidth: 2 }
  },
  { 
    id: 'e3-5', 
    source: '3', 
    target: '5',
    style: { stroke: '#6B7280', strokeWidth: 2 }
  }
];

const SimpleCanvas: React.FC = () => {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);

  const onConnect = useCallback(
    (params: Connection) => setEdges((eds: Edge[]) => addEdge(params, eds)),
    [setEdges]
  );

  return (
    <div style={{ width: '100%', height: '500px' }}>
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onConnect={onConnect}
        fitView
      >
        <Controls />
        <Background variant={BackgroundVariant.Dots} />
      </ReactFlow>
    </div>
  );
};

export default SimpleCanvas;
